import React from 'react';

import Button from './Button';
import InputField from './InputField';
import Task from './Task';

class Todo extends React.Component {

    //オンクリックの処理

    render() {
        return (
            <div>
              <InputField label="追加" />
              <hr />
              <Button label="完了" onClick/>
              <Button label="削除" />
              <ul>
                  {/*stateとpropsをわたす*/}
                <li><Task /></li>
              </ul>
            </div>
        );
    }
}

export default Todo;
